import React, { useState } from 'react';
import '../assets/styles/introdiv.css';

const ContactDiv = () => {
  return (
    <div className="contact-div">
      <div class="wrapper">
        <div class="title"></div>

        <form class="form">
          <input type="text" class="name entry " placeholder="Your Name" />

          <input type="text" class="email entry" placeholder="Email" />

          <textarea class="message entry" placeholder="Message"></textarea>

          <button class="submit entry" onclick="thanks()">
            Submit
          </button>
        </form>

        <div class="shadow"></div>
      </div>
    </div>
  );
};

export default ContactDiv;
